          "summary": "Peanut Butter Muffins might be a good recipe to expand your breakfast recipe box. This recipe makes 12 servings with <b>172 calories</b>, <b>5g of protein</b>, and <b>4g of fat</b> each. For <b>16 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. It is brought to you by Pink When. From preparation to the plate, this recipe takes roughly <b>28 minutes</b>. 1 person has made this recipe and would make it again. Head to the store and pick up salt, milk, egg, and a few other things to make it today. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. Taking all factors into account, this recipe <b>earns a spoonacular score of 35%</b>, which is rather bad. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/microwave-peanut-butter-fudge-topped-with-chocolate-mini-peanut-butter-cups-muffins-for-muffin-538986\">Microwave Peanut Butter Fudge topped with Chocolate & Mini Peanut Butter Cups | Muffins for Muffin</a>, <a href=\"https://spoonacular.com/recipes/microwave-peanut-butter-fudge-topped-with-chocolate-mini-peanut-butter-cups-muffins-for-muffin-1314869\">Microwave Peanut Butter Fudge topped with Chocolate & Mini Peanut Butter Cups | Muffins for Muffin</a>, and <a href=\"https://spoonacular.com/recipes/chocolate-chip-peanut-butter-muffins-with-peanut-butter-icing-800505\">Chocolate Chip Peanut Butter Muffins with Peanut Butter Icing</a>.",
