          "summary": "Lemon, White Wine & Herb Shrimp might be just the main course you are searching for. Watching your figure? This pescatarian recipe has <b>472 calories</b>, <b>38g of protein</b>, and <b>22g of fat</b> per serving. This recipe serves 4 and costs $4.58 per serving. 1 person has tried and liked this recipe. Head to the store and pick up linguine, garlic, white wine, and a few other things to make it today. From preparation to the plate, this recipe takes around <b>20 minutes</b>. It is brought to you by Foodista. Overall, this recipe earns a <b>pretty good spoonacular score of 42%</b>. Similar recipes are <a href=\"https://spoonacular.com/recipes/roasted-lemon-pepper-herb-chicken-thighs-with-lemon-wine-pan-sauce-1065434\">Roasted Lemon Pepper Herb Chicken Thighs with Lemon Wine Pan Sauce</a>, <a href=\"https://spoonacular.com/recipes/chicken-with-white-wine-and-herb-sauce-74325\">Chicken With White Wine And Herb Sauce</a>, and <a href=\"https://spoonacular.com/recipes/herb-grilled-shrimp-skewers-with-lemon-herb-feta-1217547\">Herb-Grilled Shrimp Skewers with Lemon-Herb Feta</a>.",
