          "instructions": "<ol><li>Rinse shrimp and pat dry with a paper towel. You can leave the tails on or remove them, I removed them here for ease of eating but I do prefer the look with them on.</li><li>Heat a large saute pan over medium low heat. Add the olive oil and garlic. Cook until fragrant.</li><li>Add in the white wine, simmer and allow to reduce by half.</li><li>Lower the heat to low, stir in the butter. Season with salt and pepper. Melt the butter and allow to cook on low for 10 minutes.</li><li>Cook the linguine until al dente.</li><li>Stir in the shrimp and cook until pink &amp; translucent, about 3-4 minutes per side, total 6-8 minutes.</li><li>Stir in the fresh lemon juice at the end.</li><li>Distribute the cooked linguine on your plates, add shrimp on top of the pasta, and pour the sauce evenly across all servings.</li></ol>",
