          "instructions": "InstructionsTake the uncooked red potatoes and place them into the Instant Pot. Cover with 2 cups of water, or more if needed. Place the lid securely into place, set the valve to \"seal\" and then put the Instant Pot on manual for 8 minutes.When the cooking time is finished, allow the Instant Pot to naturally release pressure for 10 minutes before moving the valve t0 \"vent\". I always cover mine with a hand towel just in case any thing decided to spurt out of the lid.Once the pressure has been released, remove the inner pot and drain the excess water.Place the potatoes into a bowl and add cream cheese, butter, milk, sour cream, and salt and pepper. Mash the potatoes really well and mix everything up good. Add in the chopped green onion and mix again. Serve immediately or save them for later.",
