          "tips": {
            "health": [
              "If you can, choose grassfed butter for a <a href=\"http://www.marksdailyapple.com/grass-fed-butter/#axzz3B6O62GgG\">better nutritional profile</a>&mdash;more vitamins, a favorable omega 3/6 ratio, etc.",
              "To increase the protein in this recipe, you might experiment with using yogurt or cottage cheese (blended first to achieve a smooth texture) in place of the cream cheese.",
              "To make baked goods lighter and sneak in some extra nutrition, you can swap half the butter or oil (sometimes even all of it!) with an equal amount of unsweetened applesauce.",
              "Believe it or not, some sources say you can substitute avocado puree for butter when making brownies. Try it and let us know how it turns out!",
              "Studies have shown people who drink full fat milk <a href=\"http://www.npr.org/blogs/thesalt/2014/02/12/275376259/the-full-fat-paradox-whole-milk-may-keep-us-lean\">are thinner</a> than those who drink low-fat or fat-free milk instead. Keep that in mind before you decide to swap. If you want to go dairy free, however, you can replace milk with unsweetened soy milk in most recipes.",
              "Since most of its calories come from fat, sour cream has a bad reputation for being an unhealthy food. However, <a href=\"https://spoonacular.com/academy/fat\">fat</a> is an important part of the diet and studies suggest people who eat full fat dairy <a href=\"http://www.npr.org/blogs/thesalt/2014/02/12/275376259/the-full-fat-paradox-whole-milk-may-keep-us-lean\">are thinner</a> than those who reach for reduced fat products. That said, fat has more calories per gram than carbohydrates or protein, so if you are counting calories to lose weight, you might want to try substituting greek yogurt for some of the sour cream in recipes that call for a lot of it."
            ],
            "price": [
              "Most dairy products stay good well past their sell-by date. Instead of throwing out perfectly safe food that is just a few days or maybe even a week or two old, make sure the product smells fine, has a normal texture, and doesn't taste funny. Sniff testing isn't exactly rocket science and it can keep you from wasting food (and money)."
            ],
            "cooking": [
              "To prevent curdling, take sour cream of the fridge well in advance and only add it to hot soups or sauces once it has reached room temperature and once the soup/sauce has cooled down a bit.",
              "Butter's incredible flavor has made it an extremely popular cooking fat, but it is important to know that butter has the lowest smoke point of almost any cooking fat. This means butter literally starts to smoke at a lower temperature than most other fats between 250-350 degrees Fahrenheit. So while butter is great for cooking at lower temperatures, you should probably use canola oil, coconut oil, or  <a href=\"https://spoonacular.com/academy/vegetable-oil\">another oil with a higher smoke point</a> for frying and other high temperature cooking.",
              "Confused by the <a href=\"https://spoonacular.com/academy/cream\">different types of cream</a> &mdash; Most differences arise from the fat content of the cream, and whether or not the cream has been \"soured\" by adding lactic acid bacteria to give it a tangy flavor.",
              "If you need to soften a block of cream cheese before using it, you can unwrap it and heat it in the microwave on high for 10-15 seconds at a time until it is soft enough."
            ],
            "green": [
              "To avoid antibiotics, hormones, and other nasties in your milk, choose organic whenever possible. If you can't afford organic, look for milk labeled hormone and antibiotic free. It is often less expensive."
            ]
          },
