          "summary": "Garlic Lime Grilled Chicken Salad is a <b>gluten free</b> recipe with 4 servings. For <b>$2.53 per serving</b>, this recipe <b>covers 35%</b> of your daily requirements of vitamins and minerals. This main course has <b>436 calories</b>, <b>45g of protein</b>, and <b>13g of fat</b> per serving. This recipe is liked by 2 foodies and cooks. It is perfect for <b>The Fourth Of July</b>. A mixture of corn, mexican cheese, garlic, and a handful of other ingredients are all it takes to make this recipe so scrumptious. From preparation to the plate, this recipe takes about <b>30 minutes</b>. It is brought to you by Foodista. Overall, this recipe earns a <b>great spoonacular score of 84%</b>. <a href=\"https://spoonacular.com/recipes/garlic-lime-grilled-chicken-salad-1224965\">Garlic Lime Grilled Chicken Salad</a>, <a href=\"https://spoonacular.com/recipes/garlic-lime-grilled-chicken-breasts-with-cilantro-corn-relish-428095\">Garlic-Lime Grilled Chicken Breasts with Cilantro-Corn Relish</a>, and <a href=\"https://spoonacular.com/recipes/lime-grilled-chicken-caesar-salad-472185\">Lime Grilled Chicken Caesar Salad</a> are very similar to this recipe.",
