          "instructions": "<ol><li>Mix 1/4 cup fresh orange juice, 1/4 cup fresh lime juice, oil, spices, and salt in a small bowl.</li><li>Pour half of the mixture over the chicken and save the rest of the marinade.</li><li>Marinate the chicken breast for at least an hourpreferably two.</li><li>After the chicken has marinated, prepare your grill, and heat grill to 425</li><li>Sear chicken on both sides for about 12 minutes. Reduce heat to 350 or 375 and cook for 7-10 minutes.</li><li>Cut red peppers into small strips and add to grill for 23 minutes.</li><li>Cook frozen corn, however, it should be warm when you top it on the salad.</li><li>Add 12 tablespoons of vinegar to the leftover marinade to make a vinaigrette dressing for your salad.</li><li>Top each ingredient beginning with the salad and chicken. Spoon vinaigrette dressing over prepared salads.</li></ol>",
