          "summary": "5 Ingredient High Protein Pumpkin Pancakes might be a good recipe to expand your breakfast recipe box. This recipe makes 1 servings with <b>351 calories</b>, <b>18g of protein</b>, and <b>10g of fat</b> each. For <b>$1.75 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up pumpkin puree, pumpkin pie spice, maple syrup, and a few other things to make it today. It is a good option if you're following a <b>gluten free and lacto ovo vegetarian</b> diet. It is brought to you by spoonacular user <a href=\"/profile/coffeebean\">coffeebean</a>. From preparation to the plate, this recipe takes roughly <b>15 minutes</b>. Try <a href=\"https://spoonacular.com/recipes/5-ingredient-high-protein-pumpkin-pancakes-1269389\">5 Ingredient High Protein Pumpkin Pancakes</a>, <a href=\"https://spoonacular.com/recipes/high-protein-pumpkin-pancakes-1220767\">High Protein Pumpkin Pancakes</a>, and <a href=\"https://spoonacular.com/recipes/high-protein-pumpkin-pancakes-1301621\">High Protein Pumpkin Pancakes</a> for similar recipes.",
