          "instructions": "<p> 1. Blend the rolled oats in a blender or food processor until you have a fine powder.</p><p> 2. Blend the ground oats with the cottage cheese (or quark), pumpkin puree, pumpkin pie spice, and egg.</p><p> 3. Pour the thick batter into a hot, oiled skillet and use the back of a spoon to form round pancakes.</p><p> 4. Flip the pancakes once the sides are firm and turning brown..</p><p> 5. Serve with maple syrup.</p><p><em>Note: I can count, I just don't count the maple syrup as ingredient #6 it is not required to make the pancakes themselves ;)</em></p>",
