          "summary": "Simple Chicken Breast Salad requires approximately <b>25 minutes</b> from start to finish. For <b>$4.56 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. One serving contains <b>493 calories</b>, <b>31g of protein</b>, and <b>36g of fat</b>. This recipe serves 2. This recipe from Foodista has 1 fans. If you have agave nectar, pepper, olive oil, and a few other ingredients on hand, you can make it. It works well as a main course. It is a good option if you're following a <b>gluten free, dairy free, and ketogenic</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 84%</b>. This score is tremendous. <a href=\"https://spoonacular.com/recipes/simple-italian-baked-chicken-breast-526638\">Simple Italian Baked Chicken Breast</a>, <a href=\"https://spoonacular.com/recipes/simple-grilled-bbq-skinless-boneless-chicken-breast-1308085\">Simple Grilled BBQ Skinless Boneless Chicken Breast</a>, and <a href=\"https://spoonacular.com/recipes/simple-grilled-bbq-skinless-boneless-chicken-breast-573927\">Simple Grilled BBQ Skinless Boneless Chicken Breast</a> are very similar to this recipe.",
