                "title": "Laguna Winery Russian River Chardonnay",
                "description": "Nestled in the heart of the Russian River Valley, Laguna Ranch Vineyard has been home to world-class Chardonnay for the past 30 years. The vineyard owes its long growing season to the cool fog that rolls in from the Pacific Ocean, giving our Chardonnay grapes a delicate balance between crisp acidity and ripe fruit flavors. An elegant expression of its namesake vineyard, Laguna Ranch Vineyard Chardonnay is an exceptionally well-balanced and luxurious wine. Opens with notes of apple, pear, quince and tangerine, framed by sweet undertones of Asian spice. Well balanced and rich, this Chardonnay has an expressive mouthfeel and a layered, lingering finish.",
