          "instructions": "<ol><li>In a blender, combine olive oil, vinegar, tarragon, mustard, shallots, agave, salt, and pepper. Blend until well combined. </li><li>Taste and adjust salt, pepper and agave, if needed. </li><li>In a large bowl, combine the washed greens, arugula and tomato. Scatter cooked chicken breast and carrot shavings over top of greens and tomato. Sprinkle sunflower seeds on top of everything and serve immediately.</li></ol>",
