          "summary": "Instant Pot Chicken Thighs is a <b>gluten free, dairy free, paleolithic, and primal</b> recipe with 4 servings. One portion of this dish contains approximately <b>33g of protein</b>, <b>14g of fat</b>, and a total of <b>270 calories</b>. For <b>$1.51 per serving</b>, this recipe <b>covers 16%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 1 foodies and cooks. This recipe from Pink When requires olive oil, oregano, thyme, and garlic powder. It works best as a main course, and is done in roughly <b>13 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 52%</b>, which is solid. <a href=\"https://spoonacular.com/recipes/instant-pot-chicken-thighs-1736595\">Instant Pot Chicken Thighs</a>, <a href=\"https://spoonacular.com/recipes/instant-pot-chicken-thighs-1021270\">Instant Pot Chicken Thighs</a>, and <a href=\"https://spoonacular.com/recipes/instant-pot-chicken-thighs-1515979\">Instant Pot Chicken Thighs</a> are very similar to this recipe.",
