          "summary": "If you have around <b>30 minutes</b> to spend in the kitchen, Spanish Tortilla might be an amazing <b>gluten free and fodmap friendly</b> recipe to try. For <b>$1.34 per serving</b>, you get a main course that serves 4. One portion of this dish contains around <b>19g of protein</b>, <b>12g of fat</b>, and a total of <b>260 calories</b>. This recipe is liked by 1 foodies and cooks. Only a few people really liked this European dish. This recipe from Foodista requires butter, salt and pepper, potatoes, and chicken breast. Overall, this recipe earns a <b>good spoonacular score of 49%</b>. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/spanish-egg-tortilla-with-potatoes-and-onions-tortilla-espaola-979521\">Spanish Egg Tortilla with Potatoes and Onions (Tortillan Española)</a>, <a href=\"https://spoonacular.com/recipes/spanish-tortilla-spanish-potato-omelette-1313009\">Spanish Tortilla (Spanish Potato Omelette)</a>, and <a href=\"https://spoonacular.com/recipes/spanish-tortilla-spanish-potato-omelette-694395\">Spanish Tortilla (Spanish Potato Omelette)</a>.",
