            "pairingText": "Vegetable Fried Rice on the menu? Try pairing with Wine, Alcoholic Drink, and White Wine. The best wine for Asian food depends on the cuisine and dish - of course - but these acidic whites pair with a number of traditional meals, spicy or not. The Momo Sauvignon Blanc with a 4.7 out of 5 star rating seems like a good match. It costs about 15 dollars per bottle.",
