          "summary": "Need a <b>gluten free main course</b>? Ground Beef Street Tacos could be an amazing recipe to try. This recipe makes 6 servings with <b>354 calories</b>, <b>34g of protein</b>, and <b>13g of fat</b> each. For <b>$3.35 per serving</b>, this recipe <b>covers 24%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 1 foodies and cooks. This recipe is typical of Mexican cuisine. Head to the store and pick up lime juice, onion, chili powder, and a few other things to make it today. It is brought to you by Pink When. From preparation to the plate, this recipe takes around <b>20 minutes</b>. Overall, this recipe earns a <b>solid spoonacular score of 50%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/ground-beef-street-tacos-1797683\">Ground Beef Street Tacos</a>, <a href=\"https://spoonacular.com/recipes/ground-beef-street-tacos-1624983\">Ground Beef Street Tacos</a>, and <a href=\"https://spoonacular.com/recipes/ground-beef-street-tacos-1636811\">Ground Beef Street Tacos</a>.",
