            "pairingText": "Pinot Noir, Riesling, and Sparkling rosé are great choices for Tacos. Acidic white wines like riesling or low-tannin reds like pinot noir can work well with Mexican dishes. Sparkling rosé is a safe pairing too. The Dragonette Cellars Sta. Rita Hills Pinot Noir with a 4.8 out of 5 star rating seems like a good match. It costs about 45 dollars per bottle.",
