                "title": "Dragonette Cellars Sta. Rita Hills Pinot Noir",
                "description": "2016 was another in a string of terrific vintages in Santa Barbara. We had another early budbreak, and (unlike 2015) perfect weather during set, allowing for a strong, balanced crop. May, June and July were quite warm and ripening was fairly quick; however, an unseasonably cool August slowed the vines considerably. For the winemaker it was almost ideal, as the grapes were able to complete ripening slowly, without heat spikes, and the grapes maintained excellent acidity. Over a series of cool mornings, we picked each block at near perfect ripeness and balance. The wines appear to have great fruit character, fresh acidity and tannic structure and solid depth. ",
