          "instructions": "Instructions\n\nCook ground beef with seasonings until meat is no longer pink. Set aside.\n\nWarm tortilla shells in the oven on 300 degrees Fahrenheit for 7 minutes or in a skillet on medium-high heat for 30-45 seconds on each side.\n\nScoop ground beef mixture into the tortillas.\n\nAdd sliced onion, cherry tomatoes, shredded cheese, and cilantro.\n\nSqueeze the fresh lime juice on top.\n\nTop with pico de gallo, fresh avocado, or fresh salsa.",
