          "summary": "Need a <b>dairy free breakfast</b>? Lemon Poppy Seed Muffins could be an awesome recipe to try. This recipe serves 24. One serving contains <b>130 calories</b>, <b>2g of protein</b>, and <b>4g of fat</b>. For <b>22 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. Not a lot of people made this recipe, and 5 would say it hit the spot. This recipe from Pink When requires eggs, vegetable oil, lemon cake mix, and water. From preparation to the plate, this recipe takes approximately <b>20 minutes</b>. With a spoonacular <b>score of 13%</b>, this dish is rather bad. Try <a href=\"https://spoonacular.com/recipes/lemon-poppy-seed-muffins-544322\">Lemon Poppy Seed Muffins</a>, <a href=\"https://spoonacular.com/recipes/lemon-poppy-seed-muffins-511072\">Lemon Poppy Seed Muffins</a>, and <a href=\"https://spoonacular.com/recipes/lemon-poppy-seed-muffins-415488\">Lemon Poppy Seed Muffins</a> for similar recipes.",
