          "summary": "Cashew Nut Chicken takes roughly <b>20 minutes</b> from beginning to end. This recipe serves 6. Watching your figure? This gluten free and dairy free recipe has <b>390 calories</b>, <b>25g of protein</b>, and <b>15g of fat</b> per serving. For <b>$1.94 per serving</b>, this recipe <b>covers 29%</b> of your daily requirements of vitamins and minerals. 1 person has made this recipe and would make it again. If you have vegetable oil, rice, mushroom, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. It works well as an affordable main course. All things considered, we decided this recipe <b>deserves a spoonacular score of 78%</b>. This score is solid. Similar recipes are <a href=\"https://spoonacular.com/recipes/cashew-nut-chicken-485873\">Cashew Nut Chicken</a>, <a href=\"https://spoonacular.com/recipes/chicken-and-cashew-nut-curry-112509\">Chicken and Cashew Nut Curry</a>, and <a href=\"https://spoonacular.com/recipes/chicken-in-a-cashew-nut-sauce-123071\">Chicken in a Cashew Nut Sauce</a>.",
