          "instructions": "<ol><li>Heat up a wok and vegetable oil. When the oil is hot, add garlic and brown it.</li><li>Add chicken and cook them till they all cooked through,</li><li>Add onion and mushroom and saute them till translucent</li><li>Add all other vegetable and seasonings except chili paste. Saute for about 10 mins and add chili paste. If it's too dry, add 1 tablespoon of chicken stock or water to lighten the paste.</li><li>When it's all mixed well, turn off the heat. Add cilantro and cashew nuts.</li><li>Served with warm rice</li></ol>",
