          "summary": "Garlic Lemon Chicken is a <b>gluten free and primal</b> recipe with 2 servings. For <b>$2.69 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. This main course has <b>395 calories</b>, <b>38g of protein</b>, and <b>25g of fat</b> per serving. It is brought to you by spoonacular user <a href=\"/profile/maplewoodroad\">maplewoodroad</a>. From preparation to the plate, this recipe takes around <b>30 minutes</b>. If you have anchovy, garlic - 2, olive oil, and a few other ingredients on hand, you can make it. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/lemon-chicken-scallopini-with-lemon-garlic-cream-sauce-862682\">Lemon Chicken Scallopini with Lemon Garlic Cream Sauce</a>, <a href=\"https://spoonacular.com/recipes/lemon-garlic-chicken-32020\">Lemon Garlic Chicken</a>, and <a href=\"https://spoonacular.com/recipes/lemon-garlic-chicken-649487\">Lemon - Garlic Chicken</a>.",
