          "summary": "If you want to add more <b>gluten free, dairy free, paleolithic, and lacto ovo vegetarian</b> recipes to your recipe box, Cauliflower Rice might be a recipe you should try. This recipe makes 1 servings with <b>456 calories</b>, <b>15g of protein</b>, and <b>30g of fat</b> each. For <b>$5.23 per serving</b>, this recipe <b>covers 39%</b> of your daily requirements of vitamins and minerals. It works best as a side dish, and is done in approximately <b>15 minutes</b>. A mixture of cauliflower, olive oil, flat leaf parsley, and a handful of other ingredients are all it takes to make this recipe so scrumptious. It is brought to you by spoonacular user <a href=\"/profile/maplewoodroad\">maplewoodroad</a>. Similar recipes include <a href=\"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1625893\">Cauliflower, Brown Rice, and Vegetable Fried Rice</a>, <a href=\"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1584601\">Cauliflower, Brown Rice, and Vegetable Fried Rice</a>, and <a href=\"https://spoonacular.com/recipes/cauliflower-brown-rice-and-vegetable-fried-rice-1403527\">Cauliflower, Brown Rice, and Vegetable Fried Rice</a>.",
