          "summary": "If you want to add more <b>Southern</b> recipes to your recipe box, Southern Tuna Salad might be a recipe you should try. One serving contains <b>324 calories</b>, <b>31g of protein</b>, and <b>20g of fat</b>. This recipe serves 2. For <b>$1.32 per serving</b>, this recipe <b>covers 21%</b> of your daily requirements of vitamins and minerals. It works well as a budget friendly main course. This recipe from spoonacular user <a href=\"/profile/maplewoodroad\">maplewoodroad</a> requires albacore tuna, mayonnaise, hardboiled egg, and dijon mustard. From preparation to the plate, this recipe takes about <b>5 minutes</b>. It is a good option if you're following a <b>gluten free, dairy free, whole 30, and pescatarian</b> diet. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/southern-tuna-salad-sandwich-564188\">Southern Tuna Salad Sandwich</a>, <a href=\"https://spoonacular.com/recipes/sundays-healthy-yummy-real-tuna-salad-for-tuna-salad-melt-89711\">Sunday's Healthy, Yummy, Real Tuna Salad - for Tuna Salad, Melt</a>, and <a href=\"https://spoonacular.com/recipes/health-benefits-of-tuna-mediterranean-tuna-antipasto-salad-482412\">Health Benefits of Tuna: Mediterranean Tunan Antipasto Salad</a>.",
