            "pairingText": "Pinot Noir, Merlot, and rosé Wine are great choices for Tuna. Though fish is often paired with white wine, 'meatier' fish like tuna can absolutely go with red wine. A Rosé will also pair nicely, particularly if your tunan is prepared with ingredients better suited to a white wine. The King Estate Domaine Pinot Noir with a 4.6 out of 5 star rating seems like a good match. It costs about 50 dollars per bottle.",
