          "tips": {
            "health": [
              "You can use yogurt instead of mayonnaise to make dips, sauces, and spreads that are rich in protein and less heavy.",
              "Tuna is high in protein and omega-3 fatty acids, but it can also be high in mercury. We recommend trying smaller fish, such as herring, sardines, and mackerel, in place of tuna. With the right recipes, you can get used to the fishier taste. If you really want to stick with tuna, choose light tuna over albacore and limit consumption to about one can a week.",
              "There are a bunch of great condiments you can use on a sandwich or wrap instead of mayo, such as avocado, hummus, mustard, olive oil and vinegar, etc. If you're looking to make a healthier sandwich, try using one of these healthier substitutes or at least limit yourself to one tablespoon of high-quality mayo.",
              "You can use yogurt instead of mayonnaise to salads more protein rich and less heavy."
            ],
            "price": [
              "Most dairy products stay good well past their sell-by date. Instead of throwing out perfectly safe food that is just a few days or maybe even a week or two old, make sure the product smells fine, has a normal texture, and doesn't taste funny. Sniff testing isn't exactly rocket science and it can keep you from wasting food (and money)."
            ],
            "cooking": [
              "In a pinch you can make your own Old Bay seasoning at home. Typical ingredients include celery salt, bay leaves, paprika, dry mustard, a bit of nutmeg, ground ginger, cloves, cardamom, and of course, salt and pepper. Experiment with whichever spices and herbs you have on hand until you find a ratio you like.",
              "To get perfect hard-boiled eggs, start by storing the eggs with the <a href=\"http://www.thekitchn.com/tip-perfect-hardboiled-eggs-47197\">tip of the egg</a> pointing down. This will help center the yolk. Once it is time to make the eggs, put the eggs in a pot with cold water and bring it to a boil. Once you have a rolling boil, remove the pot from the heat and cover with a lid. After 12 minutes, drain the pot and rinse the eggs in cold water. To peel, crack the egg shell on all sides and  roll it with your hand to thoroughly break up the shell.",
              "To keep your eyes from stinging and watering while cutting onions, trying popping the onion in the freezer for 15 minutes before you plan to start cooking. Chilling the onion slows the release of the enzyme responsible for teary eyes.",
              "You should not store your onions with your potatoes because the gases they emit will make each other spoil faster. For more information about selecting and storing onions, check out <a href=\"https://spoonacular.com/academy/onions\">this lesson about onions</a> in the academy.",
              "When buying <a href=\"https://spoonacular.com/academy/celery\">celery</a>, make sure the stalks feel firm and the leaves look fresh. Store in your refrigerator's crisper for up to two weeks."
            ],
            "green": [
              "Tuna's sustainability heavily depends on the fishing spots and methods. Inform yourself about where and how your tuna was caught or choose more widely sustainable options, such as herring, sardines, or mackerel instead.",
              "According to the Environmental Working Group (EWG), celery is one of the worst vegetables in term of <a href=\"http://www.ewg.org/foodnews/summary.php\">pesticide residue</a>. If you're trying to reduce pesticide residue in your diet, be sure to buy organic celery."
            ]
          },
