          "instructions": "<ol><li>In large pot, saute onion in butter, ghee or olive oil until soft</li><li>Add cubed squash and saute for a couple of minutes</li><li>Add vegetable stock and 1 3 inch piece of kombu and bring to a boil</li><li>Reduce heat and simmer until squash is soft (about 15 minutes)</li><li>Using a slotted spoon, remove squash and puree in blender</li><li>Return squash to pot and stir in black-eyed peas and cooked quinoa.</li><li>Add greens for about five minutes until soft</li><li>Add nutmeg, sea salt and pepper to taste</li></ol>",
