          "tips": {
            "health": [
              "When buying canned beans, look for the label \"no salt added\" to cut down on unnecessary <a href=\"https://spoonacular.com/academy/sodium\">sodium</a>. You can also give your regular canned beans a good rinse to remove some of the salt!",
              "Some bouillon/stock products contain gluten, some don't. If you are following a gluten-free diet, always read product labels carefully."
            ],
            "price": [],
            "cooking": [
              "If you're using olive oil to cook at high temperatures, make sure that the olive oil you're using has a high smoke point because heating an oil past its smoke point can ruin the flavor and even release harmful compounds into your dish. Many people recommend saving extra-virgin olive oil for cold dishes or for adding the finishing touch to a warm dish. You could also use canola oil, coconut oil, or another good <a href=\"https://spoonacular.com/academy/vegetable-oil\">high-temperature oil</a> to be on the safe side.",
              "If you've never made quinoa before, be sure to rinse it well before you prepare it. The easiest way is to put it in a fine-mesh strainer and run water over it from the sink. Skipping this step could result in bitter, even soapy tasting quinoa because quinoa's natural coating tastes pretty bad. Quinoa sold in supermarkets is often pre-rinsed, but its better to be safe than sorry, right?",
              "Like many ground spices, ground nutmeg loses its flavor over time. For the best nutmeg taste, purchase whole nutmeg and grate it right as you use it. If you're a real nutmeg lover, you can even buy a nutmeg grinder. ",
              "Seaweed for cooking can be found in Asian markets or on Amazon. "
            ],
            "green": [
              "Beans <a href=\"http://www.thekitchn.com/good-question-can-i-freeze-coo-74327\">freeze well</a>, so don't throw out your leftovers!"
            ]
          },
