          "summary": "The recipe Easy Korean Beef is ready <b>in approximately 30 minutes</b> and is definitely a super <b>gluten free and dairy free</b> option for lovers of Korean food. For <b>$2.02 per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains approximately <b>33g of protein</b>, <b>12g of fat</b>, and a total of <b>326 calories</b>. This recipe serves 3. This recipe from spoonacular user <a href=\"/profile/MichelleB\">MichelleB</a> requires brown sugar, sesame oil, ginger, and ground beef. It works well as an affordable main course. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/easy-korean-beef-1145752\">Easy Korean Beef</a>, <a href=\"https://spoonacular.com/recipes/easy-korean-ground-beef-1037430\">Easy Korean Ground Beef</a>, and <a href=\"https://spoonacular.com/recipes/easy-korean-beef-bowl-993735\">Easy Korean Beef Bowl</a>.",
