            "pairingText": "Riesling, Gewurztraminer, and Chenin Blanc are my top picks for Korean. The best wine for Asian food depends on the cuisine and dish - of course - but these acidic whites pair with a number of traditional meals, spicy or not. The Bollig-Lehnert Piesporter Goldtroopfchen Riesling Spatlese with a 4.5 out of 5 star rating seems like a good match. It costs about 24 dollars per bottle.",
