          "summary": "You can never have too many main course recipes, so give Pan Seared Salmon a try. This recipe serves 2. One portion of this dish contains about <b>34g of protein</b>, <b>38g of fat</b>, and a total of <b>485 calories</b>. For <b>$4.2 per serving</b>, this recipe <b>covers 26%</b> of your daily requirements of vitamins and minerals. 2 people were glad they tried this recipe. From preparation to the plate, this recipe takes around <b>25 minutes</b>. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free, dairy free, paleolithic, and primal</b> diet. If you have pepper, dill, salmon fillets, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 90%</b>. This score is spectacular. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/pan-seared-honey-glazed-salmon-with-browned-butter-lime-sauce-the-best-salmon-ive-ever-eaten-543891\">Pan Seared Honey Glazed Salmon with Browned Butter Lime Sauce – The Best Salmon I’ve Ever Eaten</a>, <a href=\"https://spoonacular.com/recipes/pan-seared-honey-glazed-salmon-with-browned-butter-lime-sauce-the-best-salmon-ive-ever-eaten-1209061\">Pan Seared Honey Glazed Salmon with Browned Butter Lime Sauce – The Best Salmon I’ve Ever Eaten</a>, and <a href=\"https://spoonacular.com/recipes/pan-seared-salmon-1551\">Pan-seared Salmon</a>.",
