            "pairingText": "Smoked Salmon can be paired with Pinot Noir, Chardonnay, and Sauvignon Blanc. To decide on white or red, you should consider your seasoning and sauces. Chardonnay is a great friend to buttery, creamy dishes, while sauvignon blanc can complement herb or citrus-centric dishes. A light-bodied, low-tannin red such as the pinot noir goes great with broiled or grilled salmon. The King Estate Domaine Pinot Noir with a 4.6 out of 5 star rating seems like a good match. It costs about 50 dollars per bottle.",
