          "instructions": "<ol><li>Place 1 tortilla on a microwave-safe plate. Lightly cover the tortilla with water. Blot the excess water off with paper towel.</li><li>Place in the microwave on the highest heat for 40 seconds.</li><li>Take the tortilla out of the microwave. The tortilla wil not be hot.</li><li>Spread 2 tbsp ricotta all over the tortilla.</li><li>Now, place the 1/4 of the smoked salmon on top of the ricotta.</li><li>Place 1/4 of the arugula leaves on top of the salmon.</li><li>Add 3 chopped basil leaves.</li><li>Now, instead of rolling the tortilla up, fold the left side a bit into the middle of the tortilla and then fold the right side a bit into the middle and then roll the filled tortilla carefully up.</li><li>Take your rolled up tortilla and turn it over. Cut diagonally into 2.</li><li>Repeat with the other tortillas until you have made all 4 wraps.</li></ol>",
