          "summary": "Pan-Seared Honey Glazed Salmon with Collard Greens is a <b>gluten free, dairy free, paleolithic, and primal</b> recipe with 2 servings. This main course has <b>457 calories</b>, <b>39g of protein</b>, and <b>26g of fat</b> per serving. For <b>$4.77 per serving</b>, this recipe <b>covers 46%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes around <b>30 minutes</b>. A mixture of collard greens, salmon steaks, freshly cracked pepper, and a handful of other ingredients are all it takes to make this recipe so tasty. It is brought to you by spoonacular user <a href=\"/profile/maplewoodroad\">maplewoodroad</a>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/pan-seared-honey-glazed-salmon-with-browned-butter-lime-sauce-the-best-salmon-ive-ever-eaten-1209061\">Pan Seared Honey Glazed Salmon with Browned Butter Lime Sauce – The Best Salmon I’ve Ever Eaten</a>, <a href=\"https://spoonacular.com/recipes/pan-seared-honey-glazed-salmon-with-browned-butter-lime-sauce-the-best-salmon-ive-ever-eaten-543891\">Pan Seared Honey Glazed Salmon with Browned Butter Lime Sauce – The Best Salmon I’ve Ever Eaten</a>, and <a href=\"https://spoonacular.com/recipes/sherry-glazed-salmon-with-collard-greens-4905\">Sherry-Glazed Salmon with Collard Greens</a>.",
